import React from "react";

const HourlyTableRow = (props) => {
  return (
    <div className="row data-row">
      <div className="col-md-2">${props.weather[props.i].description}</div>
      <div className="col-md-2">${new Date(props.dt * 1000).toUTCString()}</div>
      <div className="col-md-2">
        ${props.main.temp.toFixed(props.i)} C ($
        {props.main.feels_like.toFixed(props.i)} C)
      </div>
      <div className="col-md-2">${props.main.humidity} %</div>
      <div className="col-md-2">${props.wind.speed} km/h</div>
    </div>
  );
};

export default HourlyTableRow;
